        <ColorLetter letter="n" color="#9EBA49" />
        <ColorLetter letter="s" color="#BDCC59" />
        <ColorLetter letter="t" color="#BB463A" />
        <ColorLetter letter="e" color="#CC7355" />
        <ColorLetter letter="r" color="#D69D5E" />
        <ColorLetter letter="s" color="#D9BF6B" />
        <div>
          <p>press the button</p>
        </div>
      </div>
    </div>
  );
};

export default Logo;
